import {useState} from "react";
import Main from "../../component/js/Main";
import {Button} from "react-bootstrap";
import Test from "../../component/js/Test";

function Body() {
    const [page, setPage] = useState(<Main/>);

    function changePage(target) {
        let p = (target === 'Main' ? <Test/> : <Main/>);
        setPage(p);
    }

    return (
        <div>
            page
            <Button onClick={changePage('Main')}>test</Button>
        </div>
    )
}

export default Body;
